//! \brief Copy tabular data into min-max data fields.
//!
//! Initialization of static data need only be performed once.
void Yelle::initializeData() {
  if (initialized) {
    return;
  }
  initialized = true;

  mHeight.resize(heightSize);
  for (size_t i = 0; i < minMaxSize; ++i) {
    mTemp[i].resize(heightSize);
    mPres[i].resize(heightSize);
    mDens[i].resize(heightSize);
    mDinitrogenND[i].resize(heightSize);
    mMethaneND[i].resize(heightSize);
    mArgonND[i].resize(heightSize);
  }

  for (size_t zIndex = 0; zIndex < heightSize; ++zIndex) {
    mHeight[zIndex] = minData[zIndex].z;
    mTemp[MIN_IDX][zIndex] = minData[zIndex].temp;
    mPres[MIN_IDX][zIndex] = minData[zIndex].pres * 0.1;
    mDens[MIN_IDX][zIndex] = minData[zIndex].dens * 1.0e3;
    mDinitrogenND[MIN_IDX][zIndex] = minData[zIndex].ndn2 * 1.0e6;
    mMethaneND[MIN_IDX][zIndex] = minData[zIndex].ndch4 * 1.0e6;
    mArgonND[MIN_IDX][zIndex] = minData[zIndex].ndar * 1.0e6;

    mTemp[AVG_IDX][zIndex] = avgData[zIndex].temp;
    mPres[AVG_IDX][zIndex] = avgData[zIndex].pres * 0.1;
    mDens[AVG_IDX][zIndex] = avgData[zIndex].dens * 1.0e3;
    mDinitrogenND[AVG_IDX][zIndex] = avgData[zIndex].ndn2 * 1.0e6;
    mMethaneND[AVG_IDX][zIndex] = avgData[zIndex].ndch4 * 1.0e6;
    mArgonND[AVG_IDX][zIndex] = avgData[zIndex].ndar * 1.0e6;

    mTemp[MAX_IDX][zIndex] = maxData[zIndex].temp;
    mPres[MAX_IDX][zIndex] = maxData[zIndex].pres * 0.1;
    mDens[MAX_IDX][zIndex] = maxData[zIndex].dens * 1.0e3;
    mDinitrogenND[MAX_IDX][zIndex] = maxData[zIndex].ndn2 * 1.0e6;
    mMethaneND[MAX_IDX][zIndex] = maxData[zIndex].ndch4 * 1.0e6;
    mArgonND[MAX_IDX][zIndex] = maxData[zIndex].ndar * 1.0e6;
  }

}

